import React from 'react';
import Tilt from 'react-tilt';
import dog from './dog.png';
import './Logo.css';

const Logo = () => {
	return(
		<div className='ma4 mt0'>
			<Tilt className="Tilt br2 shadow-3" options={{ max : 55 }} style={{ height: 100, width: 100 }} >
 				<div className="Tilt-inner pa3"><img style={{paddingTop:'6px', paddingBottom:'20px', height: '60px', width: '100px'}} alt='logo' src={dog}/></div>
			</Tilt>
		</div>
	);
}

export default Logo;
